import React from 'react';

const ImageLinkForm = () => {
    return (
        <div>
            <p className='f3'>
                {'This Magic Brain will detect faces in your pictures. Give it at try.'}
            </p>
            <input type='text' className='f4'/>
            <button>Detect</button>
        </div>
    );
}

export default ImageLinkForm;
